(6, 46, 'Home', 'home', '', '<h1><strong>INDRAPRASTH FOODS LTD</strong>.</h1>\r\n<p>Introduces itself as a Reliable Manufacture &amp; Exporter and Importer of Kabuli Chickpeas, Wheat &amp; Organic Soybean and the name is synonymous for quality among the consumers. We have Three companies in India. We are in this Business for Past 41 Years and Specialize in Supplying Quality Products to Our Esteemed Consumers at most Competitive Price, Best quality and adhere to delivery on schedules.<br /> The Company aims to be an ethical &amp; diversified global entity Committed to Excellence in Consumer Satisfaction. The Company believes in Continuous business development through Dynamism, Shared Competencies, Fairness, Trust, Honesty and Sincerity.</p>\r\n<h2><strong>CEO''s Message</strong></h2>\r\n<p>Our Company is extremely thankful to all our buyers, who supported us in the market &amp; all other markets in the world. We reconfirm our commitment for reasonable price in this competitive market, good quality &amp; with utmost responsibility for shipment. Our Company would like to establish a long, sincere and friendly business relationship with all buyers.</p>', '', 1, 0, 0, 9, '2013-01-14 21:18:26', 767, '', '2013-02-15 13:08:10', 767, 0, '0000-00-00 00:00:00', '2013-01-14 21:18:26', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_posit