(7, 59, 'Work Model', 'work-model', '', '<p><strong>Our Ware House: </strong>HCA Group have a well built warehouse that is capable of storing the different products. Specious and clean, our warehouse can store a large number of products at the same time. We have divided our unit into different sections that helps in storing the products in an organized manner. To avoid any kind of damage to our products, we have fitted temperature controllers and also ensure that daily checks are carried out by warehousing experts. A proper inventory also assists in having the track of the exact amount of the products supplied and stored in our warehouse.</p>\r\n<div id="mySexyContent" style="display: none;">\r\n<div style="padding: 10px;">\r\n<h3><strong>Packaging:</strong></h3>\r\n<p>HCA Group offering a wide variety of products, we pack them in best quality packaging materials. The incorporation of packaging techniques has helped us to supply our products in safe conditions. Our packaging team ensures that all our products are safely packed in clean and hygienic conditions. We are also capable of customizing our products in packaging as per the client''s specifications.</p>\r\n<h3><strong>Important Points for our all customers:</strong></h3>\r\n<ul>\r\n<li>Quality: Best Quality for our all customers.</li>\r\n<li>Quantity: As per Buyer Requirement.</li>\r\n<li>Price: According to Quality &amp; Market.</li>\r\n<li>Certificate: As per Buyer Requirement &amp; Export Standard.</li>\r\n<li>Packing: As per Export Standard.</li>\r\n<li>Shipment: As per Buyers Requirement.</li>\r\n<li>Dispatch: After Contract 11 Working Days.</li>\r\n<li>Payment: L/c (at sight) &amp; CAD Basis.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<p><a href="#TB_inline?height=500&amp;width=500&amp;inlineId=mySexyContent" title="" rel="sexylightbox"> Read More... </a></p>', '', 1, 0, 0, 9, '2013-01-26 13:23:52', 62, '', '2013-02-26 21:38:31', 767, 0, '0000-00-00 00:00:00', '2013-02-22 19:19:33', '0000-00-00 00:00:00', '{"