(8, 54, 'Organic Soybean', 'organic-soybean', '', '<div><strong>Organic Soybean Seed<a name="soyabean"></a></strong></div>\r\n<div>Soybeans are an important global crop, providing oil and protein. The bulk of the harvest is used for oil extraction the "toasted" defatted soymeal makes possible the raising of farm animals (e.g. chicken, hog, turkey) on an industrial scale. these beans contain the most protein of all the beans. Called the "meat of the soil" they are also an excellent source of Lecithin, Vitamins A, B, and E, Calcium, Potassium, and Phosphorus. These are round in shape about the size of a pea and are a light creamy-yellow color. Although a very small portion of the crop is consumed directly by humans, soybean products do appear in a large variety of processed foods. We can offer you the best quality Organic Soybean Seed (Both food and feed quality) from India at the most competitive prices.</div>\r\n<div id="mySexyContent" style="display: none;">\r\n<div style="padding: 10px;">\r\n<div>We are a professional Organic Soybean manufacturer &amp; Exporter. We have own Organic Bean planting base ,can provide many kinds of Organic Beans and Organic Coarse Grains.If you are a distributor, wholesaler or importer , pls contact us, we are looking forward to cooperated with you.<br /> <strong>Certificates:</strong> Issured by ONE CERT</div>\r\n<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="35%">\r\n<div><strong> Product Type</strong></div>\r\n</td>\r\n<td>\r\n<div>Soybeans</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="35%">\r\n<div align="left"><strong>Style</strong></div>\r\n</td>\r\n<td>\r\n<div>Fresh</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="35%">\r\n<div align="left"><strong>Maturity</strong></div>\r\n</td>\r\n<td>\r\n<div>3 months</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="35%">\r\n<div align="left"><strong>Size</strong></div>\r\n</td>\r\n<td>\r\n<div>4.95</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="35