(9, 55, 'Indian Kabuli Chickpeas', 'indian-kabuli-chickpeas', '', '<p><strong>Kabuli Chickpeas: </strong>We are a prime <strong>Kabuli Chickpeas</strong> Manufacturer(8mm to 14mm), Exporter and Supplier in overseas market. We offer optimum quality Kabuli Chickpeas that are extremely fresh and free from unwanted impurities. Besides, Kabuli Chickpeas can be grounded up to make flour termed as gram flour. Moreover, we provide these Kabuli Chickpeas in properly sealed packaging, preserving their freshness for longer time period.</p>\r\n<div id="mySexyContent" style="display: none;">\r\n<div style="padding: 10px;">\r\n<div class="p_div">\r\n<h3><strong>Why Our Chickpeas:</strong></h3>\r\n<ul>\r\n<li>Pure</li>\r\n<li>Intact freshness</li>\r\n<li>High nutritional content</li>\r\n<li>Excellent flavor</li>\r\n</ul>\r\n</div>\r\n<div class="p_div">\r\n<h3><strong>Contain</strong></h3>\r\n<ul>\r\n<li>Iron</li>\r\n<li>Protein</li>\r\n<li>Amino Acids</li>\r\n<li>Fatty Acids</li>\r\n<li>Calcium</li>\r\n<li>Phosphorus</li>\r\n<li>Magnesium</li>\r\n<li>Potassium</li>\r\n</ul>\r\n</div>\r\n<div class="clr_div"> </div>\r\n<div class="p_div">\r\n<h3><strong>Health Benefits</strong></h3>\r\n<ul>\r\n<li>Reduce the risks of colorectal cancer</li>\r\n<li>Excellent for insulin sensitivity</li>\r\n<li>Low in fat</li>\r\n</ul>\r\n</div>\r\n<div class="p_div">\r\n<h3><strong>Used To Make</strong></h3>\r\n<ul>\r\n<li>Salads</li>\r\n<li>Stews</li>\r\n<li>Middle Eastern dish hummus</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<p><a href="#TB_inline?height=300&amp;width=400&amp;inlineId=mySexyContent" title="" rel="sexylightbox"> Read More... </a></p>', '', 1, 0, 0, 9, '2013-02-06 16:00:29', 767, '', '2013-02-26 22:26:16', 767, 0, '0000-00-00 00:00:00', '2013-02-06 16:00:29', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatex