(10, 57, 'Company Profile', 'company-profile', '', '<h2>Founder Journey:</h2>\r\n<p><strong>HCA Group was founded in 1972 by Shri Hira Lal Ji Agrawal. He started with a small pulses processing factory in Dewas (M.P.) in Central India. Over the year he built his business Brick by Brick and was created being a Pioneer in the field of grains/pulses processing. Under his leadership the HCA Group become Pioneers in Globalising &amp; Modernising the Grains/pulses Trade.</strong></p>\r\n<div id="mySexyContent" style="display: none; padding: 10px;">\r\n<div style="padding: 10px;">\r\n<h2><strong>Company Profile:</strong></h2>\r\n<p>INDRAPRASTH FOODS LTD. is a group of associates / companies (HCA Group) head office situated in DEWAS (MP) &amp; branch office in Indore (M.P.) since then we have established our self as a reputed Manufacturer &amp; Exporter-Importer of , Kabuli Chickpeas, Wheat, And Organic Soybean in India market as well as world market. Our agriculture products are available in various grades according to the requirements of our clients. As a result, we claim huge success in the markets of of Arabic country, Indian Sub Continents, Turkey, Mexico, Algeria and Canada. We offer these products in tamper-proof packaging that lock the taste and aroma of the product. We encourage timeliness and maintain transparency in all our business dealings. <br /> The Group deal in all three products Indian Kabuli Chickpeas (8mm to 12mm), Wheat (Super Quality) &amp; Organic Soybean. The company established itself as a recognized quality service provider. Our Company Also certified under APEDA, FIEO and One Cert Organisation.<br /> The Group has made substantial investments in creating world-class integrated food processing complexes. For its new range of value added, branded consumer frozen food products to be launched shortly, the Group is constructing additional Food Processing Plants with large investments in machinery and manpower.<br /> Indraprasth Food Ltd.'' contribution to India''s export effort has been recognized by the Government of India, APEDA (Ministry of Commerce), Federation of Indian Export Organizations (FIEO) and various State Governments in the form of numerous awards at national, state, and organizational levels.</p>\r\n<h2><strong>Company Mission: </strong></h2>\r\n<p>Indraprasth Foods Ltd. established with a mission to provide excellent services to it''s customer all over the globe with delight &amp; satisfaction. It''s the only essence of long term support of vendor and business relationship. Our strength grows day by day in global markets and it''s only possible with the help of our domestic supports of suppliers and our sourcing and supply chain spread across the country.</p>\r\n<h3><strong>Vision &amp; Strength:</strong></h3>\r\n<p>The company and it''s associates working with the view to establish company in next 5 years the top ranking Agro products Exporter. We have a goal to expand our selves globally with the strength of relationship.</p>\r\n<h3><strong>Company''s strength: </strong></h3>\r\n<ul>\r\n<li>Centered for quality procurement.</li>\r\n<li>Customer satisfaction.</li>\r\n<li>Our Methodology</li>\r\n<li>Improved Packing.</li>\r\n<li>Stringent quality control.</li>\r\n<li>Supply Chain/Warehousing.</li>\r\n<li>Timely shipping schedule.</li>\r\n</ul>\r\n<p>We''re in process to increasing our strength yearly with our achievements and establishments.</p>\r\n<h4><strong>Achievements:</strong></h4>\r\n<p>Achieving the twin visions of (a) rendering help to the Agro farmers by way of social services and (b) endeavouring to attain commercial gain by sustained growth of the Group. The Company has been ranked as the top Manufacturer, trader and exporter in India and has been awarded by Ministry of Agriculture , Government of India.<br /> With the expansion of the company &amp; it''s awareness we have a strong support of all India 600-1000 Agro producer farmers across different states in India. We have a valued transportation system across different states of India for procurements of best quality of Agro products and accommodate timely shipping schedule.<br /> We''re running regular awareness program in villages for the production of best quality of agro products with improved techniques of seeds and harvesting. It will help us to procure best quality of Chickpeas, Wheat, Organic Soybean and other by products.</p>\r\n<h4><strong>Quality Assurance:</strong></h4>\r\n<p>Indraprasth Foods Ltd. ensures all it''s customer for quality satisfaction and provide them all the relevant certification required in domestics and global market. The Agro &amp; agro - by products trader must acknowledged with the terms and terminology used to obtain certification of quality products.</p>\r\n</div>\r\n</div>\r\n<p><a href="#TB_inline?height=500&amp;width=500&amp;inlineId=mySexyContent" title="" rel="sexylightbox"> Read More... </a></p>', '', 1, 0, 0, 9, '2013-02-15 13:09:51', 767, '', '2013-02-26 21:15:51', 767, 0, '0000-00-00 00:00:00', '2013-02-15 13:09:51', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, 6, '', '', 1, 3273, '{"robots":"","author":"","rights":"","xrefer